function CouponManager(input) {
  this.input = input;
  this.couponCodeField = this.input.couponCodeField;
  this.couponApplied = false;
  this.couponStatus = this.input.couponStatus;
  this.$miniCartOrderSubtotal = input.miniCartOrderSubtotal;
  this.miniCartItemTotalSelector = input.miniCartItemTotal;
  this.$miniCartPromotionTotal = input.miniCartPromotionTotal;
  this.$cartItemQuantity = input.cartItemQuantity;
  this.$cartPromotionTotal = input.cartPromotionTotal;
  this.$cartTaxTotal = input.cartTaxTotal;
  this.$cartOrderTotal = input.cartOrderTotal;
  this.cartItemTotalSelector = input.cartItemTotal;
}

CouponManager.prototype.applyCoupon = function(couponCodeSelector) {
  this.couponCode = $.trim($(couponCodeSelector).val());
  if (this.couponCode !== '') {
    $('[data-hook="order-coupon-apply"]').addClass('promo-loading');

    this.createUrl();
    $(this.couponStatus).removeClass('text-green', 'text-red');
    this.sendRequest();
    return this.couponApplied;
  } else {
    return true;
  }
};

